        <div class='container w-100 vh-100 d-flex align-items-center'>
        <div id="box" class="col-6">
          <div id="box-content-container" class="col-11">
           <div class="pt-4 pb-5 pl-5 pr-5 d-flex h-100 flex-column align-items-center justify-content-around" dir="rtl">
             <img src={Logo} height="90" class="mb-3" alt="logo"/>
             <h4>دخول مسؤول المتجر</h4>
               <input type={"email"} placeholder="البريد الإلكتروني" class="input-field" onChange={(e) => setEmail(e.target.value)}/>
               <input type={"password"} placeholder="كلمة المرور" class="input-field mt-4" onChange={(e) => setPassword(e.target.value)}/>
               <button onClick={login} class="mt-5 btns filled-blue-btn" id="login-btn">تسجيل الدخول</button>
           </div>
          </div>
        </div>
      </div> 
     )



}

export default Login;
